function base64_encode(){
	python -c '
import base64, sys
sys.stdout.write(base64.b64encode(sys.stdin.read()))
	'
}

function base64_decode(){
	python -c '
import base64, sys
sys.stdout.write(base64.b64decode(sys.stdin.read()))
	'
}
